function HelloDiv() {
    return (
        <div>
            <a href={"./page1.html"}>Visit Page one</a>
            <br></br>
            <a href={"./page2.html"}>Visit Page two</a>
            <br></br>
            <a href={"./page3.html"}>Visit Page three</a>
            <br></br>
            <a href={"./page4.html"}>Visit Page four</a>
            <br></br>

        </div>
    );
}

export default HelloDiv;

